import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'
import Home from './Home';
import About from './About';

const App=()=>
{
    return (<>

            <Router>
                    <Switch>
                    <Route path='/' component={Home}></Route>
                    <Route path='/about' component={About}></Route>
                    </Switch>
                    
                
            
            </Router>
    </>)
}

export default App;
